		<link href="https://netdna.bootstrapcdn.com/font-awesome/4.6.0/css/font-awesome.min.css" rel="stylesheet" type="text/css">
		<link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/css/bootstrap.min.css">
		<style>

		/* BASE */

		body
		{
		    height: auto;
		    width: auto;
		    color: #000;
		    font-family: 'Montserrat', sans-serif;
		    font-weight: 400;
		    font-size: 12px;
		    margin: 0 auto;
		    padding: 0;
		    padding: 0;
    	}

		a, a:hover, a:visited 
		{
			color: #40BEFB;
		    text-decoration: none;
		    transition: all 0.2s ease 0s;
		}

		li{list-style:none;}

		.padding-left-0{padding-left:0;}
		.padding-right-0{padding-right:0;}
		.padding-top-0{padding-top:0;}
		.padding-bottom-0{padding-bottom:0;}


		.margin-left-0{margin-left:0px;}
		.margin-right-0{margin-right:0px;}
		.margin-bottom-0{margin-bottom:0px;}
		.margin-bottom-1{margin-bottom:15px;}
		.margin-top-1{margin-top:15px;}
		.margin-left-1{margin-left:15px;}
		.margin-right-1{margin-right:15px;}

		.text-right{text-align:right;}

		.white-bg{background:#fff;}

		.vertical-middle
		{
			position: relative;
		    top: 50%;
		    transform: translateY(50%);
		}



		/* ANIMATION */

		.animated {
		  -webkit-animation-duration: 1s;
		  -moz-animation-duration: 1s;
		  -o-animation-duration: 1s;
		  animation-duration: 1s;
		  -webkit-animation-fill-mode: both;
		  -moz-animation-fill-mode: both;
		  -o-animation-fill-mode: both;
		  animation-fill-mode: both;
		 }

		 @-webkit-keyframes fadeInRight {
		  0% {
		   opacity: 0;
		   -webkit-transform: translateX(10px);
		  }
		  100% {
		   opacity: 1;
		   -webkit-transform: translateX(0);
		  }
		 }

		 @-moz-keyframes fadeInRight {
		  0% {
		   opacity: 0;
		   -moz-transform: translateX(10px);
		  }
		  100% {
		   opacity: 1;
		   -moz-transform: translateX(0);
		  }
		 }

		 @-o-keyframes fadeInRight {
		  0% {
		   opacity: 0;
		   -o-transform: translateX(10px);
		  }
		  100% {
		   opacity: 1;
		   -o-transform: translateX(0);
		  }
		 }

		 @keyframes fadeInRight {
		  0% {
		   opacity: 0;
		   transform: translateX(10px);
		  }
		  100% {
		   opacity: 1;
		   transform: translateX(0);
		  }
		 }

		 .fadeInRight {
		  -webkit-animation-name: fadeInRight;
		  -moz-animation-name: fadeInRight;
		  -o-animation-name: fadeInRight;
		  animation-name: fadeInRight;
		 }



		/* HEADER */

		header
		{
			text-align: center;
		}

		header ul.header-list li{
			display:inline-block;
			vertical-align: middle;
		}

		header .featurelistText {text-align: right;vertical-align: middle;}

		.featurelist-icon i 
		{
		    font-size: 31px;
		    color: #666;
		    margin-left: 40px;
		    line-height: 111px;
		    padding-left: 1%;
		}

		.featurelist-text 
		{
		    font-size: 14px;
		    color: #999;
		}

		.featurelist-text span 
		{
		    font-size: 13px;
		    font-weight: normal;
		    font-style: italic;
		}

		/* ARTICLE */

		.h1, h1 {font-size: 29px;}

		span.small-price {font-size: 14px;}


		/* Frage stellen */

		.actionButton 
		{
			display: inline-block;
			width: 150px;
			height: 45px;
			text-align: center;
			line-height: 45px;
			margin: 35px 0 35px 20px;
			-o-transition: .2s;
			-ms-transition: .2s;
			-moz-transition: .2s;
			-webkit-transition: .2s;
			transition: .2s;
			font-size: 18px;
			font-weight: 400;
			padding: 0;
			text-decoration: none;
			background-color: #fff;
			border: 2px solid #333;
			color: #333;
		}

		#askNowButton {
		   display: block;
		   margin: 30px 0px;
		  }

		#askNowButton {
		  -o-transition: .2s;
		  -ms-transition: .2s;
		  -moz-transition: .2s;
		  -webkit-transition: .2s;
		  transition: .2s;
		 }

		 #askNowButton:hover {
		  background-color: #40BEFB;
		  color: #fff !important;
		  border-color: #40BEFB;
		  -o-transition: .2s;
		  -ms-transition: .2s;
		  -moz-transition: .2s;
		  -webkit-transition: .2s;
		  transition: .2s;
		 }

		/* AUF EINEN BLICK */

		.ContainerBox
		{
			background-color:#fff;
		}

		.ContainerBox h3
		{
		    color:#fff;
		    text-align:center;
		    padding:15px;
		    font-weight: 400;
		    font-size:18px;
			background: #828282;
			background: -moz-linear-gradient(top,  #828282 0%, #7e7e7e 1%, #747474 3%, #535353 4%, #2b2b2b 5%, #1e1e1e 6%, #343434 8%, #545454 9%, #696969 10%, #787878 11%, #747474 15%, #737373 41%, #707070 53%, #737373 54%, #727272 71%, #6e6e6e 81%, #737373 82%, #717171 100%);
			background: -webkit-linear-gradient(top,  #828282 0%,#7e7e7e 1%,#747474 3%,#535353 4%,#2b2b2b 5%,#1e1e1e 6%,#343434 8%,#545454 9%,#696969 10%,#787878 11%,#747474 15%,#737373 41%,#707070 53%,#737373 54%,#727272 71%,#6e6e6e 81%,#737373 82%,#717171 100%);
			background: linear-gradient(to bottom,  #828282 0%,#7e7e7e 1%,#747474 3%,#535353 4%,#2b2b2b 5%,#1e1e1e 6%,#343434 8%,#545454 9%,#696969 10%,#787878 11%,#747474 15%,#737373 41%,#707070 53%,#737373 54%,#727272 71%,#6e6e6e 81%,#737373 82%,#717171 100%); 
			filter: progid:DXImageTransform.Microsoft.gradient( startColorstr='#828282', endColorstr='#717171',GradientType=0 );

		}

		.ContainerBox li
		{
			padding:10px;
			color:#999;
		}

		.ContainerBox li i
		{
			color: #40BEFB;
			margin-right:10px;
		}

		.categoriesList .row{margin-left:0px;margin-right:0px;margin-bottom:10px;color:#999;}

		.hl-container 
		{
			margin-top: 50px;
			border: 1px solid #EBEBEB;
    		box-shadow: 0px 2px 4px 0px rgba(0, 0, 0, 0.06);
    		padding-left: 15px;
    		background: #fff;
		}

		h4.ConrainerBoxTitle
		{padding: 10px;text-align: center;font-weight: 300;font-size: 25px;}

		.hl-icon i
		{
			background-color: #40BEFB;
		    color: #fff;
		    border-radius: 0%;
		    padding: 15%;
		    float: left;
		    margin-right: 10px;
		    font-size: 20px;
		}

		.shadow
		{border: 1px solid #EBEBEB;box-shadow: 0px 2px 4px 0px rgba(0, 0, 0, 0.06);}

		/* FOOTER */	

		footer {background: #333;margin-top: 100px;padding: 30px;box-sizing: border-box;color: #d9d9d9;}
		footer p {
		    font-family: 'Montserrat', sans-serif;
		   	font-weight: 400;
    		font-size: 12px;
    		line-height: 21px;
		    color: #d9d9d9;
		    vertical-align: top;
		    padding: 0;
		    margin: 0;
		}
		footer ul{padding-left:0px;}
		footer li{padding: 2px 0;font-weight: 700;margin-bottom: 1px;}
		footer li a{color: #d9d9d9;text-decoration: none;outline: none;}
		.copyright {font-size: 10px;line-height: 12px;color: #999;}

		/* Large devices (large desktops, 1200px and up) */
		@media (min-width: 1200px) {
			nav ul.top_menu{text-align:center;}
			.parent-vertical-middle{display: flex;flex-direction: column;justify-content: center;}
		}

		/* Medium devices (desktops, 992px and up) */
		@media (min-width: 992px) and (max-width:1119px) { 
			.parent-vertical-middle{display: flex;flex-direction: column;justify-content: center;}
		}

		/* Small devices (tablets, 768px and up) */
		@media (min-width: 768px) and (max-width:991px) {
			.shop-logo img{margin: 0 auto;margin-bottom: 35px;}
		}

		@media (max-width: 768px) {
			.shop-logo img{margin: 0 auto;margin-bottom: 35px;}
			nav li {display: list-item;border-bottom:1px solid #ebebeb;text-align:center;}
			nav 
			{
				height: auto;
				box-shadow: none;
				border-color: #ebebeb;
				border-bottom: none;
			}
			nav li:first-child{border-left: none;}
			.tabBar label {width: 47%;margin-right: 1%;margin-left: 1%;margin-bottom: 10px;}
		}

		 /**Gallery CSS**/

		.gallery{margin-top: 20px;}

		#galleryHolder .stage ul>li>input+div,
		#galleryHolder .thumbs ul>li>label>div,
		#galleryHolder .thumbs ul>li>label>img,
		.stage ul>li div {
		    background-size: contain;
		    background-position: center center;
		    background-repeat: no-repeat
		}
		#galleryHolder .stage ul>li>input+div,
		#galleryHolder .thumbs ul>li,
		#galleryHolder .thumbs ul>li>label>img,
		#galleryHolder .thumbs ul>li>label>img:after {
		    background-color: rgba(255, 255, 255, 1)
		}
		#galleryHolder .thumbs ul>li {
		    width: 25%;
		    width: calc(100% / 4);
		    float: left
		}
		#galleryHolder .stage ul>li>input,
		#galleryHolder .stage ul>li[data=''] {
		    display: none
		}
		#galleryHolder .gallery {
		    margin: 0 .5rem;
		    -ms-flex: 1;
		    flex: 1;
		    -ms-flex-order: 1;
		    order: 1
		}
		#galleryHolder .stage {
		    position: relative;
		    z-index: 2;
		    width: 100%;
		    height: 0;
		    margin-bottom: .5rem;
		    padding-bottom: 100%
		}
		#galleryHolder .stage ul {
		    margin: 0;
		    padding: 0;
		    list-style: none
		}
		#galleryHolder .stage ul>li {
		    position: absolute;
		    top: 0;
		    left: 0;
		    width: 100%;
		    height: 100%;
		    box-sizing: border-box;
		}
		.stage ul>li div {
		    display: block;
		    display: -webkit-box;
		    display: -webkit-flex;
		    display: -ms-flexbox;
		    display: flex;
		    width: 100%;
		    height: 100%;
		    -webkit-transition: opacity .5s ease 0s;
		    transition: opacity .5s ease 0s;
		    opacity: 0;
		    background-color: #fff
		}
		#galleryHolder .stage ul>li>input+div {
		    display: block;
		    display: -ms-flexbox;
		    display: flex;
		    width: 100%;
		    height: 100%;
		    transition: opacity .5s ease 0s;
		    opacity: 0
		}
		#galleryHolder .stage ul>li>input:checked+div {
		    opacity: 1
		}
		#galleryHolder .thumbs {
		    position: relative;
		    z-index: 1;
		    margin: 0 -.25rem
		}
		#galleryHolder .thumbs:after {
		    content: " ";
		    display: table;
		    clear: both
		}
		#galleryHolder .thumbs ul {
		    display: -ms-flexbox;
		    display: flex;
		    margin: 0;
		    padding: 0;
		    list-style: none;
		    -ms-flex-pack: start;
		    justify-content: flex-start;
		    -ms-flex-wrap: wrap;
		    flex-wrap: wrap
		}
		#galleryHolder .thumbs ul>li:only-child,
		#galleryHolder .thumbs ul>li[data=''] {
		    display: none
		}
		#galleryHolder .thumbs ul>li {
		    height: 100%;
		    margin: auto 0
		}
		#galleryHolder .thumbs ul>li>label {
		    position: relative;
		    display: initial;
		    float: left;
		    width: 100%;
		    height: 100%;
		    margin-bottom: 20px
		}
		#galleryHolder .thumbs ul>li>label>div {
		    position: relative;
		    z-index: 4;
		    display: block;
		    width: 100%;
		    max-width: 100%;
		    height: auto;
		    margin: 0 auto;
		    cursor: pointer;
		    background-color: transparent;
		    box-sizing: border-box;
		}
		#galleryHolder .thumbs ul>li>label>div:before {
		    font-size: 0;
		    display: block;
		    padding-top: 100%;
		    content: '\00a0 '
		}
		#galleryHolder .thumbs img {
		    position: relative;
		    z-index: 4;
		    max-width: 95%;
		    height: auto;
		    cursor: pointer
		}
		.mto_cat_item_text_counter {
		    display: none
		}
		.lightbox_control,
		.lightbox_control:visited {
		    color: rgba(255, 255, 255, 1)
		}
		input:checked+.lightbox>a.lightbox_link {
		    cursor: -webkit-zoom-in;
		    display: block;
		    height: 100%;
		    width: 100%;
		    position: relative;
		    z-index: 1
		}
		#galleryHolder .stage ul>li>input+div.lightbox:target,
		.lightbox_overlay,
		.stage ul>li>input+div.lightbox {
		    transition: none!important
		}
		.lightbox_overlay {
		    display: none;
		    opacity: 0;
		    visibility: hidden;
		    position: absolute;
		    z-index: -1;
		    left: 0
		}
		:target .lightbox_overlay {
		    background-color: rgba(0, 0, 0, .9);
		    position: fixed;
		    top: 0;
		    right: 0;
		    bottom: 0;
		    left: 0;
		    z-index: 999;
		    display: -ms-flexbox;
		    display: flex;
		    opacity: 1;
		    visibility: visible;
		    -ms-flex-pack: center;
		    justify-content: center;
		    -ms-flex-align: center;
		    align-items: center
		}
		.lightbox_overlay>.lightbox_content {
		    opacity: 0;
		    overflow: visible;
		    max-height: 80vh;
		    max-width: 80%;
		    position: relative
		}
		.lightbox_overlay>.lightbox_figure {
		    transition: opacity 2s
		}
		:target .lightbox_overlay>.lightbox_content {
		    opacity: 1
		}
		:target .lightbox_overlay>.lightbox_figure {
		    display: block;
		    margin: 1.5em
		}
		.lightbox_figure img {
		    display: block;
		    /*height: 75vh;*/
		    height: 25vh;
		    max-width: 100%;
		    margin: 0 auto !important;
		}
		:target .lightbox_overlay .lightbox_figure,
		:target .lightbox_overlay .lightbox_image {
		    max-width: 80vw;
		    background-position: center 0;
		    max-height: 80vh;
		    opacity: 1;
		    position: relative
		}
		:target .lightbox_overlay .lightbox_figure {
		    position: absolute;
		    margin-top: 100px;
		    width: 80vw;
		    top: 0;
		    left: 0;
		    right: 0;
		    margin: 100px auto 0 !important;
		}
		:target .lightbox_overlay .lightbox_figure * {
		    margin: 0 auto;
		}
		:target .lightbox_overlay .lightbox_image {
		    opacity: 1;
		    display: none;
		    padding-top: 0
		}
		.lightbox_control {
		    position: absolute
		}
		.lightbox_control_icons .lightbox_control {
		    position: absolute;
		    width: 3em;
		    height: 3em;
		    background-position: 50%;
		    background-size: cover;
		    text-indent: 100%;
		    white-space: nowrap;
		    overflow: hidden
		}
		.lightbox_close {
		    top: 1em;
		    right: 1em
		}
		.lightbox_control_icons .lightbox_close {
		    top: 2.5em;
		    right: 2.5em;
		    background-image: url(data:image/svg+xml,%3Csvg%20xmlns%3D%22http%3A%2F%2Fwww.w3.org%2F2000%2Fsvg%22%20version%3D%221.1%22%20x%3D%220%22%20y%3D%220%22%20viewBox%3D%220%200%2032%2032%22%20xml%3Aspace%3D%22preserve%22%3E%3Cpath%20fill%3D%22%23fff%22%20d%3D%22M21.7%2010.3c-0.4-0.4-1-0.4-1.4%200l-4.3%204.3-4.2-4.2c-0.4-0.4-1-0.4-1.4%200-0.4%200.4-0.4%201%200%201.4l4.2%204.2-4.3%204.3c-0.4%200.4-0.4%201%200%201.4%200.4%200.4%201%200.4%201.4%200l4.3-4.3%204.2%204.2c0.4%200.4%201%200.4%201.4%200%200.4-0.4%200.4-1%200-1.4l-4.2-4.2%204.3-4.3C22.1%2011.3%2022.1%2010.7%2021.7%2010.3zM16%200C7.2%200%200%207.2%200%2016s7.2%2016%2016%2016c8.8%200%2016-7.2%2016-16S24.8%200%2016%200zM16%2030C8.3%2030%202%2023.7%202%2016S8.3%202%2016%202s14%206.3%2014%2014S23.7%2030%2016%2030z%22%2F%3E%3C%2Fsvg%3E);
		    mix-blend-mode: difference
		}
		.lightbox_control_icons .lightbox_close:hover {
		    opacity: .5
		}
		.lightbox_close_around {
		    position: absolute;
		    top: 0;
		    left: 0;
		    height: 100%;
		    width: 100%;
		    cursor: default
		}
		.lightbox_next,
		.lightbox_prev {
		    top: 15%;
		    margin-top: -1.5em;
		    opacity: .2
		}
		.lightbox_prev {
		    left: 2em
		}
		.lightbox_next {
		    right: 2em
		}
		.lightbox_control_icons .lightbox_next,
		.lightbox_control_icons .lightbox_prev {
		    margin-top: -1.5em;
		    transition: opacity .2s;
		    opacity: 1;
		    background-image: url(data:image/svg+xml,%3Csvg%20xmlns%3D%22http%3A%2F%2Fwww.w3.org%2F2000%2Fsvg%22%20version%3D%221.1%22%20x%3D%220%22%20y%3D%220%22%20width%3D%2244.1%22%20height%3D%2294.7%22%20viewBox%3D%220%200%2044.1%2094.7%22%20enable-background%3D%22new%200%200%2044.088%2094.67%22%20xml%3Aspace%3D%22preserve%22%3E%3Cpath%20fill%3D%22%23fff%22%20d%3D%22M44.1%2047.3L1.5%2094.7%200%2093.3l41.4-46L0%201.3%201.5%200%2044.1%2047.3z%22%2F%3E%3C%2Fsvg%3E)
		}
		.lightbox_control_icons .lightbox_prev {
		    left: 2em;
		    transform: rotate(180deg)
		}
		.lightbox_control_icons .lightbox_figure > .lightbox_next {
		    right: -3em;
		    margin-top: -18px !important;
		}
		.lightbox_control_icons .lightbox_figure > .lightbox_prev {
		    left: -3em;
		    margin-top: -18px !important;
		}
		.lightbox_next:focus,
		.lightbox_next:hover,
		.lightbox_prev:focus,
		.lightbox_prev:hover {
		    opacity: .5;
		    transition: opacity .2s
		}
		.lightbox_untarget {
		    position: fixed;
		    top: 0
		}
		.lightbox_content {
		    overflow: auto;
		}
		.lightbox_html {
		    padding: 2em;
		    max-width: 80%;
		    background-color: #fff
		}
		div[class*=' csslider'],
		div[class^=csslider] {
		    z-index: 1
		}
		@media only screen and (min-width: 992px) {
		    #galleryHolder .stage ul>li>input+div.lightbox:target {
		        opacity: 1;
		        visibility: visible
		    }
		}
		@media only screen and (max-width: 991px) {
		    #galleryHolder .stage ul>li>input+div.lightbox *,
		    #galleryHolder .stage ul>li>input+div.lightbox:target * {
		        display: none
		    }
		}
		@media only screen and (min-width: 1200px) {
		    .lightbox_figure img {
		        max-width: 100%
		    }
		}

		#galleryHolder .stage ul > li, #galleryHolder .thumbs ul > li > label {border: 1px solid #e4e4e4;}


#galleryHolder .thumbs ul li div {
  background-color: #fff;
  background-position: center center;
  background-repeat: no-repeat;
  background-size: contain;
  cursor: pointer;
  display: block;
  height: 100%;
  margin: 0 auto;
  width: 100%;
}

#galleryHolder .stage ul li input:checked + div {
  opacity: 1;
}

#galleryHolder {
  margin: 0;
}

#galleryHolder [class~="gallery"] {
    margin-left: 0;
}
#galleryHolder .stage ul>li>input+div,
#galleryHolder .thumbs ul>li,
